import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expanded, setExpand] = useState({
    isExpanded: false,
    expandedIndex: -1,
  });

  const handleListExpand = (index) => {
    console.log(data[index]);
    return setExpand({
      isExpanded: true,
      expandedIndex: index,
    });
  };

  console.log(data);

  if (data.child) {
    return (
      <ul className="list__items">
        <Fragment>
          <li className="list__item">{data.title}</li>
          {data.map((d) =>
            d.child && d.child.length > 0 ? <List data={d.child} /> : null
          )}
        </Fragment>
      </ul>
    );
  }

  return (
    <div className="list__container">
      <ul className="list__items">
        {data.map((d) => (
          <Fragment>
            <li className="list__item">{d.title}</li>
            {d.child && d.child.length > 0 ? <List data={d.child} /> : null}
          </Fragment>
        ))}
      </ul>
    </div>
  );
}

export default List;
